import ListingCard from "./ListingCard";

function ListingsContainer({ spaces}) {
  return (
    <main>
      <ul className="cards">
        <ListingCard spaces={listings} />
        {/* {listings.map((listing) => (
          <ListingCard
            key={listing.id}
            listing={listing}

          />
        ))} */}
      </ul>
    </main>
  );
}

export default ListingsContainer;
